    null,nt"notes": "The 2014 cartographic boundary shapefiles are simplified representations
    of selected geographic areas from the U.S. Census Bureau's Master Address File /
    Topologically Integrated Geographic Encoding and Referencing (MAF/TIGER) Database
    (MTDB). These boundary files are specifically designed for small-scale thematic
    mapping. When possible, generalization is performed with the intent to maintain
    the hierarchical relationships among geographies and to maintain the alignment of
    geographies within a file set for a given year. Geographic areas may not align with
    the same areas from another year. Some geographies are available as nation-based
    files while others are available only as state-based files.nnThis file depicts the
    shape of the United States clipped back to a generalized coastline.  This Nation
    layer covers the extent of the fifty States, the District of Columbia, Puerto Rico,
    and each of the Island Areas (American Samoa, the Commonwealth of the Northern Mariana
    Islands, Guam, and the U.S. Virgin Islands) when scale appropriate.",nt"license_title":
